import styled from 'styled-components';
import React from 'react';

const fonts = [
  "Playfair Display", "Roboto Mono", "Roboto", "Tulpen One", 
  "Bebas Neue", "Teko", "Russo One", "Gruppo", 
  "Ysabeau SC", "Press Start 2P", "Rubik Mono One", "Monoton", 
  "Pragati Narrow"
];

const TestFontContainer = styled.div`
  background-color: #333;
  padding: 20px;
`;

const TestFonts = () => {
  return (
    <TestFontContainer>
      {fonts.map(font => (
        <div key={font}>
          <TextMod font={font} size="21px" weight="800">
            {font}
          </TextMod>
          <TextMod font={font} size="21px" weight="600">
            Courage is not the absence of fear, but rather the judgment that something else is more important than fear.
          </TextMod>
          <hr />
        </div>
      ))}
    </TestFontContainer>
  );
};

export default TestFonts;


const TextMod = styled.p`
  font-family: ${props => props.font || 'Roboto'};
  font-weight: ${props => props.weight || '400'};
  font-size: ${props => props.size || '16px'};
  font-style: ${props => props.style || 'normal'};
  color: ${props => props.color || '#FFFFFF'};
  text-transform: ${props => props.transform || 'none'};
  line-height: ${props => props.lineHeight || '1.5'};
  letter-spacing: ${props => props.letterSpacing || 'normal'};
  text-align: ${props => props.textAlign || 'left'};
  // You can continue to add other text properties as required
`;
